const Color = {
	WHITE_TO_ORIGINAL: 'white-to-original',
	BLACK_TO_ORIGINAL: 'black-to-original',
	WHITE_TO_PURPLE: 'white-to-purple',
	BLACK_TO_PURPLE: 'black-to-purple',
	ALWAYS_WHITE: 'always-white',
};

export default Color;
